export default (state = null, action) => {
    switch(action.type) {
        case 'TWO_P_ROOM_CHOOSED':
            return 'two_p_room';
        case 'FOUR_P_HOUSE_CHOOSED':
            return 'four_p_house';
        case 'TWO_P_HOUSE_CHOOSED':
            return 'two_p_house';
        case 'PREMIUM_HOUSE_CHOOSED':
            return 'premium_house';
        case 'TOUR_HOUSE_CHOOSED':
            return 'tour_house';
    }
};
